(211, 'Manikandan', NULL, 'Kabalamurthy', 'manikandan.kmurthy@gmail.com', '1985-04-25', '3389530', NULL, 'MRC at LSHTM, House No. 5, Keneba,  Lower River, Gambia', 'Masters Degree', 'Marketing, Sales,  Customer Service n General Management', 1, NULL, 2, NULL, NULL, 'applicants/ManikandanKabalamurthy_20190104103211.pdf', '', '', '', NULL, 'Dear Sir/Madam,\r\n\r\nThank you very much for giving me the opportunity to share my experience.\r\n\r\n• I would like to describe myself as straight forward, simple living, quick learner, very ambitious,\r\n• I have good communication skills and find myself organized, honest and responsible, \r\n• I believe in both smartness and hard work,\r\n• I would like to say that my 10+ years work experience (Marketing/Sales/Customer Service/BD) and 4+ years business experience has taught me more than a degree.\r\n\r\nI would be glad to work with this organization to offer my best services to achieve the company\'s goal. \r\n\r\nPlease find the attached resume for your perusal.\r\n\r\nI look forward to speak with you about the employment opportunity.\r\n\r\nSincerely\r\nManikandan.K\r\nCell: +2203389530\r\nGambia', NULL, '2019-01-04 10:32:11', '2019-01-04 10:32:11'),
(212, 'Ismaila', NULL, 'Bojang', 'ibojang93@yahoo.com', '1989-10-04', '3130118', '7842193', 'Busumbala Village', 'Bachelors Degree', 'Newscaster', 4, NULL, 11, NULL, NULL, 'applicants/IsmailaBojang_20190104042512.docx', '_doc_042512.docx/p1JDKJrUWg0xRQL9xxxRNsN5neBULPcZvifgMXi7.pdf', '_doc_042512.docx/sl6GKsnkex1hDvJpilvWHTFKI9F5uj2bC3BYbSXe.pdf', '_doc_042512.docx/EhmrRa1C1s4hSJ2NRFPLxOXtOAczMBMMAMP3Gf9B.pdf', NULL, 'I will have to argue that the best work I will ever do might perhaps be casting news. I did not make such a claim on random basis. My English Language is fluent, succinct and with a desirable and lovely accent and intonation respectively. I am undoubtedly certain that having me at QTV will be of value to us all. By the way, I am dedicated, hard working, capable in both performance and competence and more importantly, I am readily available at all time and can work under pressure in all cases.', NULL, '2019-01-04 16:25:12', '2019-01-04 16:25:12'),
