(234, 'Isatou', NULL, 'Bah', 'bahiso1995@gmail.com', '1995-01-04', '3197833', '7653030', 'Tallinding', 'Advanced Diploma', 'Administration', 5, NULL, 1, NULL, NULL, 'applicants/IsatouBah_20190115113406.jpeg', '_doc_113406.jpeg/OioguTXLzjgyp7UcBBcq9adyF1vDpOegYohiHtkE.jpeg', '_doc_113406.jpeg/UnspIYzJWqxph6QmL0BdzvAiAmFTqci5ki2CpsaC.jpeg', '_doc_113406.jpeg/JcAe1JXG3gi1lr5NHsrB1jMEUgH0D1Lt3MtPg4nO.jpeg', NULL, 'Am a Gambian by nationality, young and dynamic, ready to learn and also be a team player.\r\nI assure you that I will give in my best and share the little I know with my colleagues. Am prepared to take up any challenge to get the best of me, and also to work with any supervisor and colleagues in a professional manner.', NULL, '2019-01-15 23:34:06', '2019-01-15 23:34:06'),
