(237, 'Alhagie', NULL, 'Fatty', 'fodayala@gmail.com', '1984-03-03', '3942234', '9016462', 'Sanchaba Sulay Jobe \r\nWest Coast Region \r\nThe Gambia,', 'Advanced Diploma', 'Agriculture', 4, NULL, 11, NULL, NULL, 'applicants/AlhagieFatty_20190117103849.docx', '_doc_103849.docx/canPuvbj9YtOwsJUrrdzqeSJyHnOObhDxYTFZ9QY.docx', '', '', NULL, 'Preamble: it’s quite obvious that our country depends on Agriculture and Tourism  yet still our farmers remain the poorest in the country, due to lack of awareness and empowerment, this program will served as a source of awareness to farmers in the country and allow them to talk on their difficulties too:\r\n\r\nCONCEPT: I have being doing Agriculture programs on West coast Radio for Eight years within Kombo but with the coming of QTV, I believe I can now reach cover the entire country   the concept of the program is to bring farmers together particularly enlighten them the necessary information about how to become their own managers, because the pet traders are miss leading them on things that they should know.', NULL, '2019-01-17 10:38:49', '2019-01-17 10:38:49'),
