(321, 'Francis', NULL, 'Boahene', 'fboahene195@gmail.com', '1980-10-03', '7906811', '7906811', 'Nema - Conco', 'Bachelors Degree', 'TV Production', 4, NULL, 11, NULL, NULL, 'applicants/FrancisBoahene_20190304053545.docx', '_doc_053545.docx/3J2SOkh337EETRhu6RPFV5oGRBPIRrhTo1X1q4c0.jpeg', '_doc_053545.docx/k47on0xtgmRkmTMgcu2ebd3tUKQdpsGkkVCeRdhA.jpeg', '_doc_053545.docx/irHCtijw0fRZz0bE6RdF7ntgmp5J5149PjQkaMyO.jpeg', NULL, 'I have worked as a television Producer / Director for more than 12 years in reputed production companies in Ghana. All the shows that I have Produced and Directed were successful and are still running on television. I have done a complete course in broadcasting and films. This really gives me an edge over other applicants. I have immense risk taking abilities that a fine TV Producer/Director should have. I had my experience from Ghana, South Africa, Kenya, Nigeria, \r\n\r\nBelow are some of the TV productions I coordinate and manage for Ifactorylive (TV production company base in Ghana and UK). They are shows on Africa Magic on the DSTV platform, Feva TV in Canada,  ABN TV & VOX Africa all on Sky in the UK, Flow TV Channel 100 in the Carribean eTV in the South Africa\r\n \r\n1. https://www.youtube.com/watch?v=vJ9zggfIoF4\r\n2. http://www.youtube.com/user/theifactoryLIVE?feature=guide', NULL, '2019-03-04 17:35:45', '2019-03-04 17:35:45'),
