(323, 'Sulayman', NULL, 'Jallow', 'sjallow204@gmail.com', '1997-12-02', '3490087', '3960144', 'Bundung', 'Other', 'Network Engineer', 1, NULL, 10, 'Website', NULL, 'applicants/SulaymanJallow_20190304065711.docx', '_doc_065711.docx/j6qaWa9rBgCsfgMXZHha9zNIxMJKE4wrLKMzBxGI.jpeg', '_doc_065711.docx/BwG6nDuPYPfaTc09RlxNL0bzvVx4e49Hmjqnmy25.jpeg', '', NULL, 'As  a  student  who   has  completed  studying  Cisco  Certified  Network  Associate(CCNA)  at  Management  Development  Institute(MDI)  and  currently  enrolled  in  Smart  Institute  of  Technologies  and  Engineering  for  Cisco  Certified  Network  Professional(CCNP), I  have  found  my  passion  and  commitment  of  being  a  network  technician.  As  networking  is  a  powerful  technology  that  has  the  power  to  let  everyone  in  the  world  get  in  touch  and  understand  each other,  I  would  be  very  much  committed  in  advancing  or  maintaining  the  consistency  of  your  network  if  you grant  me  the  opportunity.\r\nHowever, having  being  passed through  many  practical  tests made me a lot  skilled  in  troubleshooting  and  solving  network  issues.  Besides  to  the  above  qualifications,  I  also  studied  many  information  technologies  courses  of  which  includes  computer  technician  course. This  has also  given  me  the  ability  and  experienced  in  computer  repairing  and  maintenance.  Again  with  the  given   chance  I  would  bring  that  enthusiasm  and  expertise  to  your  company.\r\nFor  further  information  you  could  reach  me  through  these  numbers: 3960144,  3490087  , and  2526972  or email:sjallow204@gmail.com  and  I  am  kindly  looking  forward  to  hearing  you.', NULL, '2019-03-04 18:57:11', '2019-03-04 18:57:11'),
