(345, 'OUMIE', NULL, 'KORA', 'auntyoumie2@gmail.com', '1991-03-04', '3142778', '2416110', 'BAKOTEH LAYOUT', 'Higher National Diploma', 'HUMAN RESOURCE MANAGEMENT', 1, NULL, 1, 'Website', NULL, 'applicants/OUMIEKORA_20190315031147.docx', '_doc_031147.docx/KRhUFuXtQs06qrdApcU4MMMg3RHCtuGNDfhmLqCF.jpeg', '_doc_031147.docx/md217Vz8EsOeCtnSgt2eYJIcCLOnvBqUgoR30QPQ.jpeg', '_doc_031147.docx/blLe40RZZxbqDv0rl26YT8ga2dZCPzcGRNqp8ID2.jpeg', NULL, 'I AM HIGHLY SKILLED IN MICROSOFT WORD AND COMMUNICATION AND I CAN WORK WITH PERSONALITY OF ALL TYPE. THROUGH MY COURSEWORK I HAVE LEARNED A LOT ABOUT GENERAL BUSINESS , MY EDUCATION AND SKILLED WHICH I REQUIRED IN THE COLLEGE HAS MAKE BEST CANDIDATE FOR JOB.', NULL, '2019-03-15 15:11:47', '2019-03-15 15:11:47'),
