(347, 'SHEIKH', NULL, 'FAAL', 'faalsheikhtijan39@gmail.com', '1984-05-24', '3548233', '3315853', '91 SIR FARIMANG SINGHATEH STREET, BANJUL', 'Diploma', 'JOURNALISM', 4, NULL, 11, 'Radio', NULL, 'applicants/SHEIKHFAAL_20190315085321.docx', '', '', '', NULL, 'AFTER COMPLETING MY DIPLOMA IN JOURNALISM MY AMBITIONS WAS TO JOIN ONE OF THE LOCAL RADIO. BUT TO MY SURPRISE MY FAMILY DID NOT ALLOW ME DUE TO THE SITUATION UNDER JAMMEH . I DECIDED TO EMBARK ON THE JOURNEY TO ENTER ITALY. I WAS ARRESTED AT TRIPOLI AN DETAIN FOR SIX MONTHS AND LATER DEPORTED BACK HOME.\r\nDURING THE PERIOD OF MY JOURNEY I LEARNT A LOT ABOUT AFRICA AND ITS PEOPLES. PASSING THROUGH  SENEGAL ,MAURITANIA ,MALI, ALGERIA AND THEN LIBYA HAS GIVEN A GREAT EXPERIENCE ABOUT AFRICA', NULL, '2019-03-15 20:53:21', '2019-03-15 20:53:21'),
(348, 'Alieu', NULL, 'Bah', 'alieubh@gmail.com', '1991-09-26', '7298142', '5029234', '14 Clarkson Street, Banjul', 'Masters Degree', 'General Management', 1, NULL, 12, 'Website', NULL, 'applicants/AlieuBah_20190317043413.pdf', '', '', '', NULL, 'Upon graduating from the University of The Gambia with BSc in Management and Marketing, I was quick to join a multinational company tasked with the responsibility of managing relations between customers and the institution. This task helped me to build confidence, be a better communicator, a good team player, and highly customer focused. Understanding and recognizing the importance of my personal development pushed me to further my studies in Malaysia where I graduated with a Masters in Business Administration.', NULL, '2019-03-17 16:34:13', '2019-03-17 16:34:13'),
(349, 'omar', NULL, 'mendy', 'mendyomar123@gmail.com', '1995-02-15', '3954014', '2304418', 'sinchu baliya', 'Certificate', 'computer technician', 1, NULL, 3, 'friend-colleage-family', NULL, 'applicants/omarmendy_20190320114414.jpg', '_doc_114414.jpg/tFnCxYRVuHAyXrD9ooAjY84GrZxMYoQQjuapXodt.jpeg', '_doc_114414.jpg/jrsTEz7eTK5WYzq0d34asiqeYsMt0wLF1Y3n21WI.jpeg', '_doc_114414.jpg/3hCN4mhINKrn3yAVFUZOIZeA8J3J2Rrouhrz6m3Y.jpeg', NULL, 'when i finish my A+ classes at quantum net institution i came there at qcell main office applying for a job, for more than a year now but i still get no calls or information, i even came there today to see the manager but i didn\'t get permitted.\r\nright now am currently doing my Cisco Classes at quantum net. i wanted to apply as intern under your internet service provider (ISP) if given the opportunity sir, i would do my almost best to serve you genuinely. \r\nthis what i have been doing since when i finish my schooling, i want to be a specialist on networking. am not just talking to entice but am very serious right now.\r\ni really need help sir, this is what i have been wishing, wondering all day and i hope my dream will not go astray.\r\ni am looking forward in anticipation to hearing from you, thank you very much from your cooperation.', NULL, '2019-03-20 11:44:15', '2019-03-20 11:44:15'),
(350, 'Pa Modou', NULL, 'Sarjo', 'Pmodou24@gmail.com', '1991-02-18', '3731807', '2896058', 'Latrikunda Sabige\r\nThe Gambia\r\nWest Africa', 'Certificate', 'Economics', 1, NULL, 12, 'friend-colleage-family', NULL, 'applicants/Pa ModouSarjo_20190320011435.docx', '', '', '', NULL, 'I wish to apply for this job to improve my working experience and also help to boost the image of the organization. i hope that my candid request will be highly appreciated.', NULL, '2019-03-20 13:14:35', '2019-03-20 13:14:35'),
