(352, 'Abdourahim', NULL, 'Bah', 'abdourahimbah@gmail.com', '1991-03-11', '3434720', NULL, 'Manjai Kunda', 'Advanced Diploma', 'Finance officer', 1, NULL, 7, 'friend-colleage-family', NULL, 'applicants/AbdourahimBah_20190320042729.docx', '', '', '', NULL, 'It is of great interest and enthusiasm that I apply for a job in your highly respectable and noble institution.\r\nI am a final year student at the University of the Gambia; B.Sc. Mathematics. I built strong interest to develop a career in Financial math; thus my wish to join Qcell. In my years at the University, I took elective courses in Economics to dilute my core Mathematics concepts. In addition, the packed of my academic qualifications couple with my professional studies in Banking and Finance, and working experience are all added advantages.\r\nI am confident my knowledge and abilities will be of value to the Finance Unit.   I look forward to hearing from you.', NULL, '2019-03-20 16:27:29', '2019-03-20 16:27:29'),
(353, 'Ousman', NULL, 'Mbaye', 'ousmanmbaye3@gmail.com', '1988-12-12', '7019755', '6363387', 'Brikama Town', 'Graduate Diploma', 'Currently a university student', 4, NULL, 11, 'friend-colleage-family', NULL, 'applicants/OusmanMbaye_20190321103817.pdf', '_doc_103817.pdf/OI1POeDMUSxOS3A0jOMXMjgPoNhxhjQb4DvVfba6.pdf', '', '', NULL, 'Since the establishment of QTV it has ever been my interest to work with the company as a wollof and English presenter. I can also report and broadcast news more especially in wollof. \r\n  I am a wollof and can speak the language fluently and have no doubt that I will make a great impact towards achieving the mission, goals and objective of the company that will benefit all stakeholders  on the interest of the company.\r\n   I will make sure that I carry out my duty and deliver up to standard.\r\n Going through my CV you will realize that I have been serving as a role model and will maintain that status and serve as an icon to other working staff.\r\n  If my application is put into consideration I will make the wollof programs more interesting as I can speak English, Wollof and Mandinka as well.', NULL, '2019-03-21 10:38:17', '2019-03-21 10:38:17'),
