(386, 'Bakary', NULL, 'Kassama', 'bskassama@gmail.com', '1981-03-23', '7657984', NULL, 'P.O. Box 2316', 'Bachelors Degree', 'General IT specialist with a focus on Cybersecurity', 1, NULL, 6, 'Website', NULL, 'applicants/BakaryKassama_20190403105858.pdf', '', '', '', NULL, 'I recently moved back to The Gambia after being away for almost 17 years. My first job was as a cyber cafe operator for QuantumNet and was part of the QuantumNet team that worked with Africell after their launch.\r\nI am excited to be back and I am looking forward to an opportunity to learn more about the IT industry in The Gambia and to contribute in the advancement of Information Technology in The Gambia.', NULL, '2019-04-03 10:58:58', '2019-04-03 10:58:58'),
(387, 'Francis', NULL, 'Lansana', 'lansfra000@gmail.com', '2019-10-15', '3902930', '7099635', 'Busumbala', 'Diploma', 'Journalism', 4, NULL, 11, 'friend-colleage-family', NULL, 'applicants/FrancisLansana_20190403112644.docx', '', '', '', NULL, 'I have a four year experience as a pre-recorded radio magazine program producer for the Gambia Pastoral Institute (GPI).\r\nI am also a video editor and I have a great passion to continue that QTV if given the chance.\r\nI am an advanced diploma student at the media academy for journalism and communication (MAJaC).', NULL, '2019-04-03 11:26:44', '2019-04-03 11:26:44'),
