(389, 'Ebrima', NULL, 'Janha', 'Ebrimajanha45@yahoo.com', '1992-01-01', '3674740', '3674740', 'SINCHU ALAGIE', 'WASSCE', 'Customer service', 1, NULL, 2, 'Website', NULL, 'applicants/EbrimaJanha_20190404013304.jpeg', '_doc_013304.jpeg/WwhbrTCORTBZXaM92ZRKtdOU99lh5GHvbFE3R0w2.jpeg', '_doc_013304.jpeg/vWkf3oori5BOtfHby4XP3xLBTQas0efLQo8F2GW1.jpeg', '', NULL, 'I graduated in the year of 2014. I have been an Qcell fan all of my life,and with my background and experience in customer service I am sure I would be a valuable addition to your staff. I will work hard to be successful there, and I would appreciate the opportunity to meet with you. Thank you for your time and attention to this request.', NULL, '2019-04-04 13:33:04', '2019-04-04 13:33:04'),
