(391, 'Lamin', NULL, 'Fatty', 'laminwaa.fatty@gtbank.com', '1991-10-02', '3619437', '7943928', 'Brusubi housing estates', 'Other', 'Finance and administration', 1, NULL, 7, 'TV', NULL, 'applicants/LaminFatty_20190404115959.docx', '_doc_115959.docx/Yu4DrTnojrUwlG79oxbq0r8hQRznbN4dqNotx8Dp.pdf', '_doc_115959.docx/vtoTdEt9eL3Ssrc1AScm53tc9sO6C8luYgm95hsi.pdf', '_doc_115959.docx/3dqCxpkz0cVbfJUYSV8C9gIWINmHPrnufvIDPpfh.pdf', NULL, 'I am an ACCA student currently reading paper f4 and F8, business and corporate law and Audit and Assurance respectively.', NULL, '2019-04-04 23:59:59', '2019-04-04 23:59:59'),
