(393, 'Abdoullah', NULL, 'Nyassi', 'anyassi@mrc.gm', '1985-09-15', '7561487', NULL, 'Medical Research Council, Atlantic Road, FAJARA', 'Bachelors Degree', 'Data Management / Analysis', 5, NULL, 6, 'Website', NULL, 'applicants/AbdoullahNyassi_20190408113832.pdf', '', '', '', NULL, 'I am particularly interested in computer science, notably data management, programming and computing in general. My current job involves managing data for a clinical research project which specialized in detecting bacterial, protozoa and viral agents causing death in neonates. My interest developed while working as Client Support assistant on internship at I.T department of Medical Research Council, The Gambia (MRCG). \r\nMy working experience spans over six years, spent with MRCG. During this period, I have been involved in numerous studies and rise from a Data entry Clerk to a Trainee Data Manager (On-the-Job-Training (OJT)), leading and supervising data management activities. I got to appreciate the critical role data management plays in managing information and analysing health problems that confront the world, notably sub-Saharan Africa which carries the heaviest burden of world disease. After successfully completing my BSc, I took the position of a Trainee Data manager (On-the-Job-Training) for a PhD research on Transmission and acquisition of Staphylococcus aureus colonization in Gambian neonates (TASAN). Here I am responsible for routine writing and running query scripts, guiding programmers on database development and overseeing the whole data management processes.\r\nIn 2016, I obtained my BSc in Computing, specialising in Information Management with Anglia Ruskin University. My BSc dissertation was on Electronic Data Capture; determining efficiency in Rural Gambian setting, focusing on research projects operating in rural areas within MRCG. In this study I employed strategies to assess how efficient was the newly introduced Electronic Data Capture technique in MRCG within rural areas compared to the tradition Case Report Forms for research data collection.\r\nMy time in MRC has accorded me the opportunity to work and interact with a diverse group of highly experienced and reputable Scientists, Data managers and Application Developers from all over the world, learning a lot from them. This experience has also earned me to contributing to lot of publications in reputable journals. \r\n\r\nI am confident that I would live up to expectation if awarded opportunity and therefore solicit your assistance, hoping that you will consider my application.', NULL, '2019-04-08 11:38:32', '2019-04-08 11:38:32'),
