(1478, 'Ousman', NULL, 'Jammeh', 'oj22014179@utg.edu.gm', '1992-06-10', '3181753', '9336556', 'Nemakunku', 'Advanced Diploma', 'Marketing', 1, NULL, 2, 'Website', NULL, 'applicants/OusmanJammeh_20210124084156.pdf', '_doc_084156.pdf/nGtprDMedsPxyXC6swTCUyt19RHvnIfLxQKHyuSy.jpeg', '_doc_084156.pdf/Oean1Bah5OUFFnRmnYDBXCzefKF7Fwi8SLu8STX2.pdf', '_doc_084156.pdf/rUI7xDRgw80POGCWzuuBxWI1IYFgyvwAp1XJVup2.jpeg', NULL, 'Dear Sir/Madam,\r\nI’m writing to express my interest in your customer service position.  Having worked across customer service for several years at Fire Protect Gambia Ltd, I feel I would be a valuable asset to your team. I have a wealth of experience when it comes to providing customer services for mutual benefits with customers.\r\nI am also a second year student at the University of the Gambia studying Marketing as my Major. \r\nDuring my time at Fire Protect Gambia ltd, I dealt with all initial customer communications for their Safety needs by phone, mail and face to face. My number one priority was always the client, and I worked to resolve any issues they might have.\r\nAbove all, I love working with people. I’m friendly, sales driven and enjoy developing great rapport with everyone I interact with. I feel I would fit in with your vision, especially given your client-first approach and your favorable reputation within the GSM industry.\r\nI’ve attached my CV for you to review and would like the opportunity to meet with you to discuss my candidacy further.\r\nThank you for considering me for the customer service advisor position. I look forward to hearing back from you.\r\n\r\nOusman Jammeh\r\n3181753', NULL, '2021-01-24 08:41:56', '2021-01-24 08:41:56'),
(1479, 'Fatima', NULL, 'Faye', 'fayefatima19@gmail.com', '1992-06-07', '3471952', NULL, 'Laterikunda German', 'Bachelors Degree', 'Software Project Management/System Administrator', 1, NULL, 6, 'Website', NULL, 'applicants/FatimaFaye_20210126012521.pdf', '_doc_012521.pdf/B2a1eYJdlIGIkIXr7jijUyhaetr5Am3D3v0WOgqL.pdf', '', '', NULL, 'I am Fatima Faye and I am a Bachelors degree holder In Information Systems, I am applying for this position or any suitable vacant position in your company. I have been exposed to different information technology courses during my studies, which have given me the opportunity to start my career journey as an Assistant software project manager in one of the IT/Software Companies in the Gambia. \r\nThat Experience has helped me improve my communication and critical thinking skills and many more. I am out to build on my career and I see your company as the best place to be because, with all the new innovations you are coming up with, I have projected that. the future of technology is in your hands and I want to be part of the driving force toward achieving that.  As there is still so much to be explored and learned in the industry, I would love to work and learn new things with you. I am very aware of the excellent Services you are giving to your customers as I am one of your many customers. I sincerely hope you will grant me the honor to work with you.', NULL, '2021-01-26 13:25:21', '2021-01-26 13:25:21'),
