(1481, 'Aminatta', NULL, 'Sillah', 'aminatta21@icloud.com', '2002-03-21', '3639587', '9944399', 'Brusubi Phase two', 'Diploma', 'none', 1, NULL, 2, 'TV', NULL, 'applicants/AminattaSillah_20210127064640.JPG', '_doc_064640.JPG/Z0wv0R5jefyOd8fLRjLvPpRf3pM0FVG3oqDnmj5A.jpeg', '_doc_064640.JPG/rEtWwAoiAIyCid3lnZcSNK5g9MNip1SD33A64A0h.jpeg', '_doc_064640.JPG/SLwRv5wzqxotNhCHojQVDlCFgf0Ul9FdtYoeZKCf.jpeg', NULL, 'I am humble and down to earth, i am fluent in English Language, Mandinka and Wolof. I have potential in interacting with people.', NULL, '2021-01-27 18:46:40', '2021-01-27 18:46:40'),
